import React from "react";
import '../App.css';



function aboutMe() {
  return (
    <div id="#aboutMe">
        <p>
            Nashbi Grand-Jean is a software engineer located in Atlanta, Georgia. <br></br> He's been building websites for many years
            but most recently acquired a certification in full-stack engineering from the Georgia Institute of Technology.
        </p>
    </div>

  )};

  export default aboutMe;
